func ClearCompanyName(companyName string) string {

	for _, cp := range cmpyParts {
		companyName = strings.Replace(companyName, cp, "_", -1)
	}
	companyNameParts := strings.Split(companyName, "_")
	for _, cp := range companyNameParts {
		if cp != "" && len(strings.Split(cp, "")) > 1 {
			return cp
		}
	}
	return ""
}

type matchcp struct {
	key    string
	cdkeys []string
}

var matchs = []matchcp{}

func init() {
	ccps := make([]string, len(cps2))
	copy(ccps, cps2)
	sort.Slice(ccps, func(i, j int) bool {
		return len(ccps[i]) >= len(ccps[j])
	})
	mk := map[string]int{}
	for _, cp := range cps2 {
		if _, ok := mk[cp]; ok {
			continue
		}
		mk[cp] = 1
		mtp := matchcp{key: cp}

		for _, ccp := range ccps {
			if strings.Contains(ccp, cp) {
				mtp.cdkeys = append(mtp.cdkeys, ccp)
			}
		}
		//if len(mtp.cdkeys) == 1 {
		//	fmt.Println(mtp.key)
		//}
		matchs = append(matchs, mtp)
	}
}

var areaSymbol = []string{"省", "市", "区", "县", "乡", "州", "镇"}

func clearCompanyName2(companyName string) string {
	for _, mt := range matchs {
		if strings.Contains(companyName, mt.key) {
			tcompanyName := companyName
			for _, cp := range mt.cdkeys {
				tcompanyName = strings.Replace(tcompanyName, cp, "_", -1)
			}
			if len(strings.Split(strings.Replace(tcompanyName, "_", "", -1), "")) > 1 {
				companyName = tcompanyName
			} else {
			}
		}

	}
	companyNameParts := strings.Split(companyName, "_")
	for _, cp := range companyNameParts {
		if cp != "" && len(strings.Split(cp, "")) > 1 {
			for _, as := range areaSymbol {
				if strings.Index(cp, as) > 0 {
					if as == "州" {
						if strings.Contains(cp, "九州") {
							continue
						}
					}
					cpp := strings.Split(cp, as)
					if len(cpp) > 1 {
						return cpp[1]
					} else {
						return ""
					}
				}
			}
			return cp
		}
	}
	return ""
}

